///SPDX-License_Identifier: MIT
pragma solidity 0.8.30;

// IMPORTS
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

/** 
 * @title Contrato Mensaje 
 * @author Franco Emanuel Morales 
 * @notice Este contrato es parte del primer proyecto del Ethereum Developer Pack 
 * @custom:security Este es un contrato educativo y no debe ser usado en producciÃ³n 
 */ 
contract lottery is ReentrancyGuard {
    //STATE VARIABLES
    uint256 public immutable ticketAmount;         // cantidad exacta para jugar (wei)
    uint256 public immutable winDenominator;       // probabilidad = 1 / winDenominator
    uint256 public immutable payoutPercentOnWin;   // porcentaje (0-100) del balance que recibe el ganador
    uint256 public immutable feePercent;           // porcentaje (0-100) del ticket que va a la cuenta hardcodeada

    address payable public constant FEE_RECIPIENT = payable(0x5B38Da6a701c568545dCfcB03FcB875f56beddC4);

    uint256 private nonce;

    // EVENTS
    event Deposited(address indexed from, uint256 amount);
    event Played(address indexed player, bool won, uint256 reward, uint256 contractBalanceAfter);
    event FeeSent(address indexed recipient, uint256 amount);

    // CONSTRUCTOR
    constructor(
        uint256 _ticketAmount,
        uint256 _winDenominator,
        uint256 _payoutPercentOnWin,
        uint256 _feePercent
    ) {
        require(_ticketAmount > 0, "ticket>0");
        require(_winDenominator > 0, "denominator>0");
        require(_payoutPercentOnWin <= 100 && _payoutPercentOnWin > 0, "payout% <= 100");
        require(_feePercent <= 100 && _feePercent > 0, "fee% <= 100");
        require(FEE_RECIPIENT != address(0), "set valid fee recipient");

        ticketAmount = _ticketAmount;
        winDenominator = _winDenominator;
        payoutPercentOnWin = _payoutPercentOnWin;
        feePercent = _feePercent;
    }
    
    // EXTERNAL

    function deposit() external payable {
        require(msg.value > 0, "zero deposit");
        emit Deposited(msg.sender, msg.value);
    }

    receive() external payable {
        emit Deposited(msg.sender, msg.value);
    }

    function play() external payable nonReentrant {
        require(msg.value == ticketAmount, "send exact ticket amount");
        
        uint256 contractBalanceBefore = address(this).balance;

        uint256 fee = (ticketAmount * feePercent) / 100;
        (bool feeSent, ) = FEE_RECIPIENT.call{value: fee}("");
        require(feeSent, "fee transfer failed");
        emit FeeSent(FEE_RECIPIENT, fee);


        bool won = ((_pseudoRandom() % winDenominator) == 0);
        uint256 reward = 0;

        if (won) {
            uint256 currentBalance = contractBalanceBefore;
            reward = (currentBalance * payoutPercentOnWin) / 100;

            if (reward > 0) {
                (bool sent, ) = payable(msg.sender).call{value: reward}("");
                require(sent, "payout failed");
            }
        }

        emit Played(msg.sender, won, reward, contractBalanceBefore);
    }

    // INTERNAL

    function _pseudoRandom() internal returns (uint256) {
        unchecked { nonce++; }
        return uint256(keccak256(abi.encodePacked(block.timestamp, block.difficulty, msg.sender, nonce)));
    }

    // VIEW

    function contractBalance() external view returns (uint256) {
        return address(this).balance;
    }
}

